_garagePage.garagePage.visit();
// Получаем случайную марку автомобиля
_garagePage.garagePage.getRandomOption('#addCarBrand').then(brand => {
  cy.get('#addCarBrand').select(brand);
  // Получаем случайную модель автомобиля
  _garagePage.garagePage.getRandomOption('#addCarModel').then(model => {
    cy.get('#addCarModel').select(model);
    // Добавляем автомобиль с случайными значениями
    const car = {
      brand,
      model,
      mileage: Math.floor(Math.random() * 1000).toString()
    };
    _garagePage.garagePage.addCar(car);
    _garagePage.garagePage.verifyCarIsAdded(`${car.brand} ${car.model}`);
  });
});
